import { Box, Heading } from "@chakra-ui/react";

export default function Pic(props) {
  const { numero } = props;
  return (
    <Box>
      <Heading size="md">GIORNO {numero}</Heading>
      <Box minH="250px" shadow="md"></Box>
    </Box>
  );
}
